import { useNavigate } from "react-router-dom";

export default function PageGrid({ pages, viewMode, selectedPage }) {
  const navigate = useNavigate();

  return (
    <div className="page-grid">
      {pages.map((page) => (
        <div
          key={page.pageId}
          className="page-card"
          onClick={() => useNavigate(`/${page.pageId}`)}
        ></div>
      ))}
    </div>
  );
}
